import React, { Component } from 'react';
import GoogleMapReact from 'google-map-react';//todo ishlamasa o`chirib tashsa
import MapMarker from './MapMarker';

class MapBlock extends Component {
    constructor(props) {
        super(props);
        this.state = {
            clickedMarker: null
        };
    }

    static defaultProps = {
        center: {
            lat: 50.6304916,
            lng: 3.0526526
        },
        zoom: 14
    };

    render() {
        return (
            // Important! Always set the container height explicitly
            <div style={{flex: '0 0 35rem', height: '100vh', position: 'sticky', top: '0'}}>
                <div className=""
                     style={{height: '100%', width: '100%', position: 'absolute', top: '0px', left: '0px'}}>
                    <GoogleMapReact
                        bootstrapURLKeys={{key: ""}}
                        defaultCenter={this.props.center}
                        defaultZoom={this.props.zoom}
                    >
                        {this.props.meals.map(m => {
                            return (
                                <MapMarker
                                    lat={m.restaurant.latitude}
                                    lng={m.restaurant.longitude}
                                    key={m.restaurant.id}
                                    meal={m}
                                    hoveredRestaurant={this.props.hoveredRestaurant}
                                />
                            )
                        })}
                    </GoogleMapReact>
                </div>
            </div>
        );
    }
}

export default MapBlock;
